import React, { Component } from 'react';
import './CurriculumContent.css';

class CurriculumContent extends Component {
  render() {
    return (
      <div className='curriculum-content'>
        <h1>Curriculum Content</h1>
      </div>
    );
  }
}

export default CurriculumContent;
